<script lang="ts">
import { defineComponent, onMounted, ref } from '@vue/composition-api'
import { MessagesService } from '../services/messagesService'
import { framesInterface, messagesInterface, virtualFramesInterface, audioInterface, scrollDetails } from '../services/types'
import ShiningStar from '../components/ShiningStar.vue'
import StarMessage from '../components/starMessage.vue'

const maxSize = 100
const framesList: framesInterface[] = []
const numStars = ref(10)
const msgPtr = ref(0)
const mute = ref(false)

const audio = ref<Element | null>(null)

const cities = ['tokyo', 'kyoto', 'osaka']

for (let i = 0; i < maxSize; i++) {
  framesList.push({
    src: 'bg-1.png'
  })
}

Object.freeze(framesList)

export default defineComponent({
  name: 'MainPage',
  components: { ShiningStar, StarMessage },
  setup (_, ctx) {
    const msg = ref('')
    const wishbox = ref(true)
    const { getMessages, postMessage, messages } = MessagesService()
    const messageSet = ref<messagesInterface[]>([])

    onMounted(async () => {
      const ele = ctx.refs.framesRef as virtualFramesInterface
      ele.scrollTo(0)
      const framesContainer: Element = document.getElementById('framesID') as Element
      setInterval(() => {
        if (framesContainer.scrollLeft <= ele.virtualScrollSizesAgg[0]) {
          framesContainer.scrollTo(framesContainer.scrollLeft + 2, 0)
        }
      }, 20)

      setInterval(() => {
        numStars.value = randNum(5, 15)
      }, 10000)

      await getMessages()
      messageSet.value = sliceMessage(msgPtr.value, 5)
      const audioele = ctx.refs.audio as audioInterface
      audioele.play()
    })

    const post = async () => {
      await postMessage(msg.value)
      msg.value = ''
    }

    const randNum = (min: number, max: number) => {
      return Math.floor(Math.random() * (max - min + 1) + min)
    }

    const sliceMessage = (start: number, size: number) => {
      return messages.value.slice(start, Math.min(start + size, messages.value.length))
    }

    const next = () => {
      msgPtr.value++
      messageSet.value = sliceMessage(msgPtr.value, 5)
    }

    const advent = () => {
      location.replace('https://okanohikari.com')
    }

    const dear2021 = () => {
      location.replace('https://dear2021.okanohikari.com')
    }

    const story = () => {
      location.replace('https://okanohikari.com/?page_id=924')
    }

    const toggleMute = () => {
      const ele = ctx.refs.audio as audioInterface
      mute.value = !mute.value
      ele.muted = mute.value
    }
    const city = ref('tokyo')
    const scrolling = (details: scrollDetails) => {
      city.value = cities[details.index % 3]
    }
    return {
      framesList,
      wishbox,
      numStars,
      msg,
      messages,
      post,
      messageSet,
      next,
      advent,
      dear2021,
      story,
      mute,
      toggleMute,
      audio,
      scrolling,
      city
    }
  }
})
</script>
